
CREATE TABLE `users_test` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `oldId` varchar(200) DEFAULT NULL,
  `username` varchar(16) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `sec_answer` varchar(200) DEFAULT NULL,
  `sec_quest_id` int(25) DEFAULT NULL,
  `email` varchar(60) DEFAULT NULL,
  `mail_reminder` varchar(200) DEFAULT NULL,
  `reminder_send` varchar(200) NOT NULL,
  `type` varchar(200) DEFAULT NULL,
  `wallpaper` varchar(255) NOT NULL,
  `wallpaperfile` varchar(155) DEFAULT NULL,
  `intake_id` varchar(200) NOT NULL DEFAULT '0',
  `finished` varchar(200) DEFAULT NULL,
  `sex` enum('','M','F') DEFAULT NULL,
  `age` int(4) DEFAULT NULL,
  `city` varchar(200) DEFAULT NULL,
  `region` varchar(255) NOT NULL,
  `education` varchar(200) DEFAULT NULL,
  `lastVisit` varchar(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

